ekday = wday(started_at, label = TRUE)) %>% \n  group_by(member_casual, weekday) %>% \n  summarise(number_of_rides = n()\n            ,average_duration = mean(ride_length)) %>% \n  arrange(member_casual, weekday)  %>%\nggplot(aes(x = weekday, y = average_duration, fill = member_casual)) +\n  geom_col(position = \"dodge\") +\n  ggtitle(label = 'Average ride lenght by client type', subtitle = 'Duration in minutes by weekday') +\n  xlab(\"Weekday\") + ylab(\"Average duration (minutes)\") +\n  scale_fill_discrete(name = \"Client type\")\nfinal_graph_1","metadata":{"execution":{"iopub.status.busy":"2023-04-25T11:37:12.367509Z","iopub.execute_input":"2023-04-25T11:37:12.368746Z","iopub.status.idle":"2023-04-25T11:37:18.167157Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### Create a visualization with number of rides by client type and weekday\n#### Group the data by client type and weekday, and calculate the number of rides\n","metadata":{}},{"cell_type":"code","source":"rides_by_type_weekday <- trips_cleaned %>%\n  group_by(member_casual, weekday) %>%\n  summarize(num_rides = n()/1000)\nfinal_graph_2 <- ggplot(rides_by_type_weekday, aes(x = weekday, y = num_rides, fill = member_casual)) +\n  geom_col(position = \"dodge\") +\n  ggtitle(label = \"Number of rides by weekday, and by client type\") +\n  labs(x = \"Weekday\", y = \"Number of rides (in thousands)\", fill = \"Client type\")\nfinal_graph_2\n","metadata":{"execution":{"iopub.status.busy":"2023-04-25T11:37:18.169587Z","iopub.execute_input":"2023-04-25T11:37:18.170921Z","iopub.status.idle":"2023-04-25T11:37:18.733287Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### Analyze last year trend  by client type, grouped by month. Of course, there is a seasonal trend (in winter, bike usage is lower in Chicago)\n","metadata":{}},{"cell_type":"code","source":"final_graph_3 <- trips_cleaned %>%\n  mutate(month = lubridate::floor_date(started_at, \"month\")) %>%\n  group_by(month, member_casual) %>%\n  summarise(n_rides = n()/1000) %>%\nggplot(aes(x = month, y = n_rides, color = member_casual)) +\n  geom_bar() +\n  labs(title = \"Number of rides by client type and month\",\n       x = \"Month\",\n       y = \"Number of rides (in thousands)\")\nfinal_graph_3","metadata":{"execution":{"iopub.status.busy":"2023-04-25T11:37:18.735731Z","iopub.execute_input":"2023-04-25T11:37:18.737056Z","iopub.status.idle":"2023-04-25T11:37:19.937376Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### Start the geographical analysis\n","metadata":{}},{"cell_type":"code","source":"library(ggmap)\nskim_without_charts(trips_cleaned)\n","metadata":{"execution":{"iopub.status.busy":"2023-04-25T11:37:19.939871Z","iopub.execute_input":"2023-04-25T11:37:19.941234Z","iopub.status.idle":"2023-04-25T11:38:09.145557Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### Group the data by start station name and calculate the number of rides for each station\n","metadata":{}},{"cell_type":"code","source":"start_station_counts <- trips_cleaned %>%\n  group_by(start_station_name, member_casual) %>%\n  summarise(count = n()) %>%\n  arrange(desc(count))\n","metadata":{"execution":{"iopub.status.busy":"2023-04-25T11:38:09.149217Z","iopub.execute_input":"2023-04-25T11:38:09.150576Z","iopub.status.idle":"2023-04-25T11:38:10.418358Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### Get a Chicago's map\n##### last time I try get_googlemap() function asks for a API key that I had to get. As this moment is free\n","metadata":{}},{"cell_type":"code","source":"secret_value_0 <- get_user_secret(\"Maps_API_key\")\n\nregister_google(key = secret_value_0)\n\nmap_chicago <- get_googlemap(center = c(lon = -87.6298, lat = 41.8781), zoom = 11)\nggmap(map_chicago)\n","metadata":{"execution":{"iopub.status.busy":"2023-04-25T11:38:10.422251Z","iopub.execute_input":"2023-04-25T11:38:10.423782Z","iopub.status.idle":"2023-04-25T11:38:12.400099Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### Group by longitude and latitude, and client type. And then count number of rides in each group. I used 20 top locations to focus where to promote physicalmarketing programs\n","metadata":{}},{"cell_type":"code","source":"rides_by_location <- trips_cleaned %>% \n  group_by(start_lng, start_lat, member_casual) %>% \n  summarize(num_rides = n()) %>% \n  ungroup()\ntop20_rides_by_location_member <- rides_by_location %>% \n  filter(member_casual == \"member\") %>% \n  top_n(20, num_rides)\ntop20_rides_by_location_casual <- rides_by_location %>% \n  filter(member_casual == \"casual\") %>% \n  top_n(20, num_rides)\n","metadata":{"execution":{"iopub.status.busy":"2023-04-25T11:38:12.404077Z","iopub.execute_input":"2023-04-25T11:38:12.406522Z","iopub.status.idle":"2023-04-25T11:39:00.267898Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### Plot the map and the data on top of it\n","metadata":{}},{"cell_type":"code","source":"ggmap(map_chicago) +\n  geom_point(data = top20_rides_by_location_member, aes(x = start_lng, y = start_lat), color=\"red\") +\n  geom_point(data = top20_rides_by_location_casual, aes(x = start_lng, y = start_lat), color=\"blue\") +\n  scale_size(range = c(1, 10)) +\n  labs(title = \"Most frequent rides starting locations in Chicago\",\n       caption = \"Red = Members. Blue = Casual riders\") +\n  theme(axis.text = element_blank(),\n        axis.title = element_blank(),\n        axis.line = element_blank())\n","metadata":{"execution":{"iopub.status.busy":"2023-04-25T11:39:00.270337Z","iopub.execute_input":"2023-04-25T11:39:00.271643Z","iopub.status.idle":"2023-04-25T11:39:01.821543Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Conclutions\n#### In the analysis above, I was able to infer that casual cyclists and members differ in the following points:\n#### Casuals use the service more on weekends, especially between May and October. The rest of the year demand little service. On average, the casual tours are longer (in time).\n#### Members tend to use the service less during the winter months (December to February), but it is also significantly higher than casual members.\n#### In general, in winter the casuals demand very little service.\n#### There is also a geographical peculiarity. The stations most used by members are further south of the city, in the Hide Park area, although they are also concentrated in the downtown area (near Greektown, West Loop Gate, and the University of Illinois). For their part, the busiest stations for casual users are located in the downtown area to the north of the city. (Lincoln Park, Lake View). We can say that a high percentage of uses occur within a radius of about 6 mi (10 km) from Downtown Chicago (The Loop), with much more activity within a radius of 4 mi (6.5 km) from The Loop.\n\n# Recomendations\n#### Increase marketing efforts during the winter months to target members, who tend to use the service less during this time. Offer discounts or promotions to encourage usage.\n#### Increase the number of bikes available during weekends and peak seasons to cater to the high demand from casual users.\n#### Consider introducing different pricing tiers or packages to incentivize more usage from both casual and member users.\n\n#### As a business person I would ask for financial information as well to give a comprehensive recommendation. I'd like to know what's the gross margin per client type. I think that, given the low usage during winter months, there may not be much more demand for memberships. I would explore more on this before launching a whole marketing campaign.\n","metadata":{}}]}